                           unsigned char *dst, int dst_size)

{

    int len, code;

    unsigned char *dst_end       = dst + dst_size;

    const unsigned char *src_end = src + src_size;



    while (src < src_end && dst < dst_end) {

        code = *src++;

        if (code & 0x80) {

